      function getBase64Image(src) {
        return new Promise(resolve => {
          const img = $('<img>');
          img[0].crossOrigin = 'anonymous';
          img.on('load', () => {
            const canvas = document.createElement("canvas");
            canvas.width = img[0].width;
            canvas.height = img[0].height;
            const ctx = canvas.getContext("2d");
            ctx.drawImage(img[0], 0, 0);
            canvas.width = 64;
            canvas.height = 64;
            resolve(canvas.toDataURL("image/png"));
          });
          img.attr('src', src);          
        });        
      }

      var base64 = getBase64Image(document.getElementById("imageid"));
    
      $(document).ready(()=>{
        /*
        for(const entry of log) {
          entry.img = await getBase64Image(`../../images/${iconMap[entry.message.match(/[A-Z]{3,4}-[A-Z]{3}/g)?.[0] ?? 'default'] ?? iconMap.default}-logo.png`);
        }
        */

        const $ul = $('<ul>', { class: "mylist" }).append(
          log
          .sort((a,b) => a.logType == 'INFO' ? b.logType == 'INFO' ? 0 : -1 : 1)
          .map((entry) => 
            $("<li>")
              .append($('<img>')
                .attr('src', iconData[entry.message.match(/[A-Z]{3,4}-[A-Z]{3}/g)?.[0] ?? 'default'] ?? iconData.default)
                .attr('width',64))
              .append($("<a>")
                .text(entry.message))
                .addClass(entry.logType == 'ERROR' ? 'red' : 'green'))
        );

        $('body').append($ul);
      });

      (async () => {
        for(const entry of log) {
          entry.img = await getBase64Image(`../../images/${iconMap[entry.message.match(/[A-Z]{3,4}-[A-Z]{3}/g)?.[0] ?? 'default'] ?? iconMap.default}-logo.png`);
        }
      })();
    
    </script>
